import React from "react";
import Contact from "./Contact";
import About from "./About";
import {Route, Routes} from 'react-router-dom';
import Nav from "./Nav";
import Error from "./Error";

const App = () =>{


     return(
        <>
            <Nav />
            <br/>
            <Routes>
                <Route exact path='/' render={()=><About name='about'/> } />
                <Route path="/contact" />
                <Route />
            </Routes>
        </>
     )
}

export default App;
